import {
  Drawer,
  IconButton,
  InputAdornment,
  TextField,
  Button,
  List,
  Typography,
  Divider,
  ListItem,
  ListItemButton,
  ListItemIcon,
  ListItemText,
  ListItemAvatar,
  Avatar,
} from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";
import "../../style/LeftDrawer.css";
import { useState } from "react";
import SearchIcon from "@mui/icons-material/Search";
import DoubleArrowIcon from "@mui/icons-material/DoubleArrow";
import {
  Add,
  CalendarMonth,
  FormatListBulleted,
  Logout,
  TextSnippet,
  Tune,
} from "@mui/icons-material";

interface LeftDrawerProps {
  open: boolean;
  onClose: (data: boolean) => void;
}

export default function LeftDrawer({ open, onClose }: LeftDrawerProps) {
  const [searchText, setSearchText] = useState<string>("");

  const taskItems = [
    {
      title: "Upcoming",
      icon: <DoubleArrowIcon />,
      noti: 1,
    },
    {
      title: "Today",
      icon: <FormatListBulleted />,
      noti: 2,
    },
    {
      title: "Calendar",
      icon: <CalendarMonth />,
      noti: 0,
    },
    {
      title: "Sticky Wall",
      icon: <TextSnippet />,
      noti: 12,
    },
  ];

  const listsItems = [
    {
      title: "Personal",
      noti: 1,
    },
    {
      title: "Work",
      noti: 2,
    },
  ];

  return (
    <Drawer
      anchor="left"
      open={open}
      variant="persistent"
      classes={{
        paper: "custom-drawer-paper",
      }}
    >
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          marginBottom: "20px",
        }}
      >
        <Typography variant="h5">Menu</Typography>
        <IconButton onClick={() => onClose(false)}>
          <MenuIcon />
        </IconButton>
      </div>

      <TextField
        size="small"
        color="secondary"
        value={searchText}
        placeholder="Search"
        sx={{ marginBottom: "20px" }}
        onChange={(e) => setSearchText(e.target.value)}
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
              <SearchIcon />
            </InputAdornment>
          ),
        }}
      />

      <div style={{ marginBottom: "5%" }}>
        <Typography variant="body2" sx={{ fontWeight: "bold" }}>
          TASK
        </Typography>

        <List>
          {taskItems.map((item, idx) => (
            <ListItem disablePadding key={idx}>
              <ListItemButton>
                <ListItemIcon>{item.icon}</ListItemIcon>
                <ListItemText primary={item.title} />
                {item.noti !== 0 && (
                  <ListItemAvatar>
                    <Avatar
                      variant="rounded"
                      sizes="small"
                      sx={{
                        backgroundColor: "transparent",
                        color: "#cdcdcd",
                        border: "solid 1px #cdcdcd",
                      }}
                    >
                      {item.noti}
                    </Avatar>
                  </ListItemAvatar>
                )}
              </ListItemButton>
            </ListItem>
          ))}
        </List>

        <Divider />
      </div>

      <div style={{ marginBottom: "5%" }}>
        <Typography variant="body2" sx={{ fontWeight: "bold" }}>
          LIST
        </Typography>

        <List>
          {listsItems.map((item, idx) => (
            <ListItem disablePadding key={idx}>
              <ListItemButton>
                <ListItemIcon>
                  <div
                    style={{
                      width: "16px",
                      height: "16px",
                      borderRadius: "3px",
                      backgroundColor: "red",
                    }}
                  ></div>
                </ListItemIcon>
                <ListItemText primary={item.title} />
              </ListItemButton>
            </ListItem>
          ))}
          <ListItem disablePadding>
            <ListItemButton>
              <ListItemIcon>
                <Add />
              </ListItemIcon>
              <ListItemText primary="Add New List" />
            </ListItemButton>
          </ListItem>
        </List>
        <Divider />
      </div>
      <div>
        <Typography variant="body2" sx={{ fontWeight: "bold" }}>
          TAGS
        </Typography>

        <Divider />
      </div>

      <div>
        <Button onClick={() => alert("open setting")} color="secondary">
          <Tune />
          Setting
        </Button>
        <Button onClick={() => alert("sign out")} color="secondary">
          <Logout />
          Sign Out
        </Button>
      </div>
    </Drawer>
  );
}
